pragma solidity ^0.8;



contract Kill{
    bool private disable;
    constructor()payable{

    }
    modifier Disable(){
        require(!disable,"Already annul");
        _;
    }

    function kill()external Disable{
        disable = true;
        // 将合约中的主币发送出去   不接受主币的合约地址 也会被强制接受 
        selfdestruct(payable(msg.sender));
    }

    function test()external view Disable returns(uint){
        return 123;
    }
}

